import { Link } from "react-router-dom";
import s from './404.module.css'

export function Error404(){
    return(
        <div className={s.errorBlock}>
                <div>
                    404
                </div>
                <Link to="/login">
                    Go to Login
                </Link>
        </div>
    )
}
